oFF.XEncoderUtils = {

	JSON_KEY_TYPE:"type",
	deserializeFromJsonString:function(json, overrideResultType)
	{
			return oFF.XEncoderUtils.deserializeFromJsonStructure(oFF.JsonParserFactory.createFromString(json).asStructure(), overrideResultType);
	},
	deserializeFromJsonStructure:function(json, overrideResultType)
	{
			if (oFF.isNull(json))
		{
			return null;
		}
		let resultType;
		if (oFF.notNull(overrideResultType))
		{
			resultType = overrideResultType;
		}
		else
		{
			resultType = oFF.XEncoderResultType.lookup(json.getStringByKey(oFF.XEncoderUtils.JSON_KEY_TYPE));
		}
		let result = null;
		if (resultType === oFF.XEncoderResultType.AES)
		{
			let cypherText = json.getStringByKey(oFF.XEncoderAESResult.FIELD_KEY_CYPHER_TEXT);
			let initializationVector = json.getStringByKey(oFF.XEncoderAESResult.FIELD_KEY_INITIALIZATION_VECTOR);
			if (oFF.XStringUtils.isNotNullAndNotEmpty(cypherText) && oFF.XStringUtils.isNotNullAndNotEmpty(initializationVector))
			{
				let coder64 = oFF.XBase64.getInstance();
				result = oFF.XEncoderAESResult.create(coder64.decodeToBytes(initializationVector), coder64.decodeToBytes(cypherText));
			}
		}
		else if (resultType === oFF.XEncoderResultType.NOOP)
		{
			let content = json.getStringByKey(oFF.XEncoderNoopResult.FIELD_KEY_CONTENT);
			if (oFF.XStringUtils.isNotNullAndNotEmpty(content))
			{
				result = oFF.XEncoderNoopResult.create(content);
			}
		}
		return result;
	},
	generateUnsecureStableAESSecret:function(keyId)
	{
			return oFF.XEncoderSecretFactory.getInstance().createAESSecretFromJsonString(oFF.XEncoderUtils.generateUnsecureStableAESSecretJsonString(keyId));
	},
	generateUnsecureStableAESSecretJson:function(keyId)
	{
			if (oFF.XStringUtils.isNullOrEmpty(keyId))
		{
			return null;
		}
		let json = oFF.PrStructure.create();
		json.putString(oFF.XEncoderAESResult.FIELD_KEY_ALGORITHM, "A256GCM");
		json.putBoolean("ext", true);
		json.putString("k", oFF.XStringUtils.concatenate2("FFY", oFF.XSha1.createSHA1(keyId)));
		let keyOps = json.putNewList("key_ops");
		keyOps.addString("encrypt");
		keyOps.addString("decrypt");
		json.putString("kty", "oct");
		return json;
	},
	generateUnsecureStableAESSecretJsonString:function(keyId)
	{
			let json = oFF.XEncoderUtils.generateUnsecureStableAESSecretJson(keyId);
		if (oFF.isNull(json))
		{
			return null;
		}
		return oFF.PrUtils.serialize(json, false, false, 0);
	},
	serializeResult:function(result, saveType)
	{
			if (oFF.isNull(result))
		{
			return null;
		}
		let json = oFF.PrStructure.create();
		let type = result.getType();
		if (saveType)
		{
			json.putString(oFF.XEncoderUtils.JSON_KEY_TYPE, type.getName());
		}
		if (type === oFF.XEncoderResultType.AES)
		{
			let aesResult = result;
			json.putString(oFF.XEncoderAESResult.FIELD_KEY_CYPHER_TEXT, aesResult.getCypherTextBase64());
			json.putString(oFF.XEncoderAESResult.FIELD_KEY_INITIALIZATION_VECTOR, aesResult.getInitializationVectorBase64());
		}
		else if (type === oFF.XEncoderResultType.NOOP)
		{
			let noopResult = result;
			json.putString(oFF.XEncoderNoopResult.FIELD_KEY_CONTENT, noopResult.getContent());
		}
		else
		{
			throw oFF.XException.createIllegalArgumentException("Invalid IXEncoderResult type");
		}
		return oFF.PrUtils.serialize(json, false, false, 0);
	}
};

oFF.XHierarchyComparator = function() {};
oFF.XHierarchyComparator.prototype = new oFF.XObject();
oFF.XHierarchyComparator.prototype._ff_c = "XHierarchyComparator";

oFF.XHierarchyComparator.create = function()
{
	return new oFF.XHierarchyComparator();
};
oFF.XHierarchyComparator.prototype.compare = function(o1, o2)
{
	if (o1.isNode())
	{
		if (o2.isLeaf())
		{
			return -1;
		}
	}
	else
	{
		if (o2.isNode())
		{
			return 1;
		}
	}
	let s1 = o1.getName();
	let s2 = o2.getName();
	return oFF.XString.compare(s1, s2);
};

