oFF.XEventEmitter = function() {};
oFF.XEventEmitter.prototype = new oFF.XObject();
oFF.XEventEmitter.prototype._ff_c = "XEventEmitter";

oFF.XEventEmitter.createEmitter = function()
{
	let newInstance = new oFF.XEventEmitter();
	newInstance.initEmitter();
	return newInstance;
};
oFF.XEventEmitter.prototype.m_consumerMap = null;
oFF.XEventEmitter.prototype.m_maxListeners = 0;
oFF.XEventEmitter.prototype.m_onceListenerMap = null;
oFF.XEventEmitter.prototype._getConsumerCollectionCreateIfNeeded = function(eventName)
{
	let tmpConsumerCollection = this.m_consumerMap.getByKey(eventName);
	if (oFF.isNull(tmpConsumerCollection))
	{
		tmpConsumerCollection = oFF.XConsumerCollection.create();
		this.m_consumerMap.put(eventName, tmpConsumerCollection);
	}
	return tmpConsumerCollection;
};
oFF.XEventEmitter.prototype._registerOnceListener = function(eventName, listenerUuid)
{
	if (!this.m_onceListenerMap.containsKey(eventName))
	{
		this.m_onceListenerMap.put(eventName, oFF.XList.create());
	}
	this.m_onceListenerMap.getByKey(eventName).add(listenerUuid);
};
oFF.XEventEmitter.prototype._removeOnceListenersIfNeeded = function(eventName)
{
	let onceListenersList = this.m_onceListenerMap.getByKey(eventName);
	let tmpConsumerCollection = this.m_consumerMap.getByKey(eventName);
	if (oFF.XCollectionUtils.hasElements(onceListenersList) && oFF.notNull(tmpConsumerCollection))
	{
		oFF.XCollectionUtils.forEach(onceListenersList, (listenerUuid) => {
			tmpConsumerCollection.removeConsumerByUuid(listenerUuid);
		});
		onceListenersList.clear();
	}
};
oFF.XEventEmitter.prototype._validateMaxListeners = function(eventName)
{
	if (this.m_consumerMap.getByKey(eventName).size() > this.m_maxListeners)
	{
		throw oFF.XException.createException("[RangeError] Maximum listeners on a XEventEmitter instance reached");
	}
};
oFF.XEventEmitter.prototype.addListener = function(eventName, consumer)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(eventName) && oFF.notNull(consumer))
	{
		let eventConsumerCollection = this._getConsumerCollectionCreateIfNeeded(eventName);
		this._validateMaxListeners(eventName);
		return eventConsumerCollection.addConsumer(consumer);
	}
	return null;
};
oFF.XEventEmitter.prototype.emit = function(eventName, data)
{
	let tmpConsumerCollection = this.m_consumerMap.getByKey(eventName);
	if (oFF.notNull(tmpConsumerCollection))
	{
		tmpConsumerCollection.accept(data);
		this._removeOnceListenersIfNeeded(eventName);
		return true;
	}
	return false;
};
oFF.XEventEmitter.prototype.getEventNames = function()
{
	return this.m_consumerMap.getKeysAsReadOnlyList();
};
oFF.XEventEmitter.prototype.getListenerCount = function(eventName)
{
	let consumerCollection = this.m_consumerMap.getByKey(eventName);
	if (oFF.notNull(consumerCollection))
	{
		return consumerCollection.size();
	}
	return 0;
};
oFF.XEventEmitter.prototype.getListeners = function(eventName)
{
	let consumerCollection = this.m_consumerMap.getByKey(eventName);
	if (oFF.notNull(consumerCollection))
	{
		return consumerCollection.getValuesAsReadOnlyList();
	}
	return oFF.XList.create();
};
oFF.XEventEmitter.prototype.getMaxListeners = function()
{
	return this.m_maxListeners;
};
oFF.XEventEmitter.prototype.initEmitter = function()
{
	this.m_maxListeners = 10;
	this.m_consumerMap = oFF.XHashMapByString.create();
	this.m_onceListenerMap = oFF.XHashMapByString.create();
};
oFF.XEventEmitter.prototype.offByUuid = function(listenerUuid)
{
	return this.removeListenerByUuid(listenerUuid);
};
oFF.XEventEmitter.prototype.on = function(eventName, consumer)
{
	return this.addListener(eventName, consumer);
};
oFF.XEventEmitter.prototype.once = function(eventName, consumer)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(eventName) && oFF.notNull(consumer))
	{
		let listenerUuid = this.addListener(eventName, consumer);
		this._registerOnceListener(eventName, listenerUuid);
		return listenerUuid;
	}
	return null;
};
oFF.XEventEmitter.prototype.prependListener = function(eventName, consumer)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(eventName) && oFF.notNull(consumer))
	{
		let eventConsumerCollection = this._getConsumerCollectionCreateIfNeeded(eventName);
		this._validateMaxListeners(eventName);
		return eventConsumerCollection.prependConsumer(consumer);
	}
	return null;
};
oFF.XEventEmitter.prototype.prependOnceListener = function(eventName, consumer)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(eventName) && oFF.notNull(consumer))
	{
		let listenerUuid = this.prependListener(eventName, consumer);
		this._registerOnceListener(eventName, listenerUuid);
		return listenerUuid;
	}
	return null;
};
oFF.XEventEmitter.prototype.releaseObject = function()
{
	this.m_consumerMap = oFF.XCollectionUtils.releaseEntriesAndCollectionIfNotNull(this.m_consumerMap);
	this.m_onceListenerMap = oFF.XObjectExt.release(this.m_onceListenerMap);
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.XEventEmitter.prototype.removeAllListeners = function(eventName)
{
	let consumerCollection = this.m_consumerMap.getByKey(eventName);
	if (oFF.notNull(consumerCollection))
	{
		this.m_consumerMap.remove(eventName);
		consumerCollection.clear();
	}
	return this;
};
oFF.XEventEmitter.prototype.removeListenerByUuid = function(listenerUuid)
{
	oFF.XCollectionUtils.forEach(this.m_consumerMap.getValuesAsReadOnlyList(), (consumerCollection) => {
		consumerCollection.removeConsumerByUuid(listenerUuid);
	});
	return this;
};
oFF.XEventEmitter.prototype.setMaxListeners = function(maxListeners)
{
	this.m_maxListeners = maxListeners;
	return this;
};

