oFF.SamlUtils.createUriWithQuery = function(request, webdispatcherTemplate, path)
{
	let newRequest = oFF.HttpRequest.createByHttpRequest(request);
	newRequest.setPath(path);
	let uri = oFF.XUri.createFromUrl(oFF.XConnectHelper.replaceWebdispatcherParameters(newRequest, webdispatcherTemplate));
	let authQueryMap = request.getAuthQueryMap();
	let authQueryMapIterator = authQueryMap.getKeysAsIterator();
	while (authQueryMapIterator.hasNext())
	{
		let key = authQueryMapIterator.next();
		let value = authQueryMap.getByKey(key);
		if (!oFF.XStringUtils.containsString(path, oFF.XStringUtils.concatenate2(key, "="), false))
		{
			uri.addQueryElement(key, value);
		}
	}
	return uri;
};
oFF.SamlUtils.getAuthTimeout = function(session)
{
	let liveConnAuthTimeout = session.getEnvironment().getByKey(oFF.XEnvironmentConstants.LIVE_CONNECTION_AUTH_TIMEOUT);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(liveConnAuthTimeout))
	{
		try
		{
			let parsedTimeout = oFF.XInteger.convertFromString(liveConnAuthTimeout);
			if (parsedTimeout >= oFF.SamlUtils.DEFAULT_AUTH_TIMEOUT && parsedTimeout <= oFF.SamlUtils.MAX_AUTH_TIMEOUT)
			{
				return parsedTimeout;
			}
		}
		catch (e)
		{
			return oFF.SamlUtils.DEFAULT_AUTH_TIMEOUT;
		}
	}
	return oFF.SamlUtils.DEFAULT_AUTH_TIMEOUT;
};
oFF.SamlUtils.getAuthenticationPath = function(request, useGetServerInfo)
{
	let systemType = request.getSystemType();
	if (useGetServerInfo)
	{
		return systemType.getServerInfoPath();
	}
	if (request.getCustomSSOPath() !== null)
	{
		return request.getCustomSSOPath();
	}
	return systemType.getAuthHtmlPath();
};
oFF.SamlUtils.getAuthenticationUrl = function(request)
{
	let webdispatcherTemplate = oFF.SamlUtils.getWebdispatcherTemplate(request);
	if (request.getAuthQueryMap().isEmpty())
	{
		let authRequest = oFF.HttpRequest.createByHttpRequest(request);
		authRequest.setPath(oFF.SamlUtils.getAuthenticationPath(request, false));
		return oFF.XConnectHelper.replaceWebdispatcherParameters(authRequest, webdispatcherTemplate);
	}
	let useGetServerInfo = oFF.SamlUtils.useGetServerInfo(request);
	let authenticationPath = oFF.SamlUtils.getAuthenticationPath(request, useGetServerInfo);
	let uri = oFF.SamlUtils.createUriWithQuery(request, webdispatcherTemplate, authenticationPath);
	return uri.getUrl();
};
