oFF.XPerformance.prototype.m_isLogMeasurements = false;
oFF.XPerformance.prototype.m_performanceTimeline = null;
oFF.XPerformance.prototype.m_runningMeasurements = null;
oFF.XPerformance.prototype._getLastMark = function(markName)
{
	let foundMark = null;
	for (let i = this.m_performanceTimeline.size() - 1; i >= 0; i--)
	{
		let entry = this.m_performanceTimeline.get(i);
		if (entry.getType() === oFF.XPerformanceEntryType.MARK && oFF.XString.isEqual(entry.getName(), markName))
		{
			foundMark = entry;
			break;
		}
	}
	return foundMark;
};
oFF.XPerformance.prototype.clearMarks = function(name)
{
	oFF.XCollectionUtils.removeIf(this.m_performanceTimeline, (entry) => {
		return entry.getType() === oFF.XPerformanceEntryType.MARK && oFF.XStringUtils.isNullOrEmpty(name) || oFF.XString.isEqual(entry.getName(), name);
	});
};
oFF.XPerformance.prototype.clearMeasures = function(name)
{
	oFF.XCollectionUtils.removeIf(this.m_performanceTimeline, (entry) => {
		return entry.getType() === oFF.XPerformanceEntryType.MEASURE && oFF.XStringUtils.isNullOrEmpty(name) || oFF.XString.isEqual(entry.getName(), name);
	});
};
oFF.XPerformance.prototype.endSimpledMeasure = function(name)
{
	if (this.m_runningMeasurements.containsKey(name))
	{
		let startMillis = this.m_runningMeasurements.getByKey(name).getDouble();
		let endMillis = this.now();
		let resultMillis = endMillis - startMillis;
		if (this.m_isLogMeasurements)
		{
			let message = oFF.XStringUtils.concatenate5("[XPerformance] Finished measurement for: ", name, ". Result -> ", oFF.XDouble.convertToString(resultMillis), "ms");
			oFF.XLogger.println(message);
		}
		this.m_runningMeasurements.remove(name);
		return resultMillis;
	}
	return 0.0;
};
oFF.XPerformance.prototype.getEntries = function()
{
	return this.m_performanceTimeline;
};
oFF.XPerformance.prototype.getEntriesByName = function(name)
{
	return oFF.XCollectionUtils.filter(this.m_performanceTimeline, (entry) => {
		return oFF.XString.isEqual(entry.getName(), name);
	});
};
oFF.XPerformance.prototype.getEntriesByType = function(entryType)
{
	return oFF.XCollectionUtils.filter(this.m_performanceTimeline, (entry) => {
		return entry.getType() === entryType;
	});
};
oFF.XPerformance.prototype.initPerformance = function()
{
	this.m_runningMeasurements = oFF.XHashMapByString.create();
	this.m_performanceTimeline = oFF.XList.create();
	this.m_isLogMeasurements = false;
};
oFF.XPerformance.prototype.mark = function(name, description)
{
	if (oFF.XStringUtils.isNullOrEmpty(name))
	{
		throw oFF.XException.createException("[XPerformance] missing mark name!");
	}
	let newMark = oFF.XPerformanceMark.create(name, description, this.now());
	this.m_performanceTimeline.add(newMark);
};
oFF.XPerformance.prototype.measure = function(name, startMarkName, endMarkName, description)
{
	if (oFF.XStringUtils.isNullOrEmpty(name))
	{
		throw oFF.XException.createException("[XPerformance] missing measure name!");
	}
	let startMark = this._getLastMark(startMarkName);
	let endMark = this._getLastMark(endMarkName);
	if (oFF.isNull(startMark))
	{
		throw oFF.XException.createException(oFF.XStringUtils.concatenate2("[XPerformance] could not find the start mark with name: ", startMarkName));
	}
	let startMillis = startMark.getStartTime();
	let endMillis = oFF.notNull(endMark) ? endMark.getStartTime() : this.now();
	let resultMillis = endMillis - startMillis;
	if (resultMillis <= 0)
	{
		throw oFF.XException.createException("[XPerformance] the startMark cannot be greater then the endMark!");
	}
	let newMeasure = oFF.XPerformanceMeasure.create(name, description, startMillis, resultMillis);
	this.m_performanceTimeline.add(newMeasure);
	return resultMillis;
};
oFF.XPerformance.prototype.now = function()
{
	return oFF.XSystemUtils.now();
};
oFF.XPerformance.prototype.releaseObject = function()
{
	if (oFF.XPerformance.s_instance === this)
	{
		throw oFF.XException.createException("[XPerformance] the singleton instance cannot be released!");
	}
	this.m_runningMeasurements = oFF.XCollectionUtils.releaseEntriesAndCollectionIfNotNull(this.m_runningMeasurements);
	this.m_performanceTimeline = oFF.XCollectionUtils.releaseEntriesAndCollectionIfNotNull(this.m_performanceTimeline);
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.XPerformance.prototype.startSimpleMeasure = function(name)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(name))
	{
		this.m_runningMeasurements.put(name, oFF.XDoubleValue.create(this.now()));
		if (this.m_isLogMeasurements)
		{
			let message = oFF.XStringUtils.concatenate2("[XPerformance] Starting measurement for: ", name);
			oFF.XLogger.println(message);
		}
	}
};

