oFF.XInterruptStepManager = function() {};
oFF.XInterruptStepManager.prototype = new oFF.XObjectExt();
oFF.XInterruptStepManager.prototype._ff_c = "XInterruptStepManager";

oFF.XInterruptStepManager.create = function()
{
	let newObj = new oFF.XInterruptStepManager();
	newObj.setup();
	return newObj;
};
oFF.XInterruptStepManager.prototype.m_interruptStepListener = null;
oFF.XInterruptStepManager.prototype.notifyInterruptStep = function(interruptStep, start)
{
	this.removeReleasedListeners();
	if (start)
	{
		for (let i = 0; i < this.m_interruptStepListener.size(); i++)
		{
			let listenerReg = this.m_interruptStepListener.get(i);
			let listener = listenerReg.m_listener;
			let customIdentifier = listenerReg.m_customIdentifier;
			listener.onInterruptStepStart(interruptStep, customIdentifier);
		}
	}
	else
	{
		for (let i = this.m_interruptStepListener.size() - 1; i >= 0; i--)
		{
			let listenerReg = this.m_interruptStepListener.get(i);
			let listener = listenerReg.m_listener;
			let customIdentifier = listenerReg.m_customIdentifier;
			listener.onInterruptStepEnd(interruptStep, customIdentifier);
		}
	}
};
oFF.XInterruptStepManager.prototype.notifyInterruptStepEnd = function()
{
	this.notifyInterruptStep(oFF.XInterruptStep.create(), false);
};
oFF.XInterruptStepManager.prototype.notifyInterruptStepStart = function()
{
	this.notifyInterruptStep(oFF.XInterruptStep.create(), true);
};
oFF.XInterruptStepManager.prototype.registerInterruptStepListener = function(listener, priority, customIdentifier)
{
	this.m_interruptStepListener.add(oFF.XInterruptStepListenerReg.create(listener, priority, customIdentifier));
	this.m_interruptStepListener.sortByComparator(oFF.XInterruptStepComparator.create());
};
oFF.XInterruptStepManager.prototype.releaseObject = function()
{
	this.m_interruptStepListener = oFF.XObjectExt.release(this.m_interruptStepListener);
	oFF.XObjectExt.prototype.releaseObject.call( this );
};
oFF.XInterruptStepManager.prototype.removeReleasedListeners = function()
{
	for (let i = 0; i < this.m_interruptStepListener.size(); )
	{
		let listenerReg = this.m_interruptStepListener.get(i);
		let listener = listenerReg.m_listener;
		if (listener.isReleased())
		{
			this.m_interruptStepListener.removeAt(i);
		}
		else
		{
			i++;
		}
	}
};
oFF.XInterruptStepManager.prototype.setup = function()
{
	this.m_interruptStepListener = oFF.XList.create();
};
oFF.XInterruptStepManager.prototype.unregisterInterruptStepListener = function(listener)
{
	for (let i = 0; i < this.m_interruptStepListener.size(); )
	{
		let listenerReg = this.m_interruptStepListener.get(i);
		let currentListener = listenerReg.m_listener;
		if (currentListener === listener)
		{
			this.m_interruptStepListener.removeAt(i);
		}
		else
		{
			i++;
		}
	}
};

