{
	return !this.isEmpty();
};
oFF.SqlJsonRsMetaData.prototype.isEmpty = function()
{
	return this.size() === 0;
};
oFF.SqlJsonRsMetaData.prototype.size = function()
{
	return this.m_columns.size();
};

