oFF.MicroKernel.prototype.setupExt = function(environmentConfig)
{
	this.m_environment = this.prepareEnvVariables(environmentConfig);
	this.m_globalInterruptManager = oFF.XInterruptStepManager.create();
	this.m_dateTimeProvider = oFF.XDefaultDateTimeProvider.create();
	this.m_defaultSyncType = oFF.SyncType.BLOCKING;
	this.m_networkLocation = oFF.NetworkEnv.getLocation();
	this.m_stdioContext = oFF.XStdio.getInstance();
	this.m_proxySettings = oFF.ProxySettings.create(null);
	this.m_proxySettings.loadFromEnvironment(this.m_environment);
	this.m_capabilities = oFF.XHashSetOfString.create();
	this.prepareFeatureToggles();
};

