oFF.IoSession.prototype.setupIoSession = function(microKernel, parent)
{
	this.m_microKernel = microKernel;
	this.m_parentSession = parent;
	this.m_startTimeInMilliseconds = oFF.XSystemUtils.getCurrentTimeInMilliseconds();
	this.m_singletons = oFF.XHashMapByString.create();
	this.m_localInterruptManager = oFF.XInterruptStepManager.create();
	this.m_workingDirectoryChangedConsumers = oFF.XConsumerCollection.create();
	this.m_featureToggles = oFF.XHashSetOfString.create();
	this.m_sessionGuid = this.m_microKernel.newSessionGuid();
	let sessionFeatures = parent;
	if (oFF.isNull(sessionFeatures))
	{
		sessionFeatures = this.m_microKernel;
	}
	this.m_dateTimeProvider = sessionFeatures.getDateTimeProvider();
	this.m_networkLocation = sessionFeatures.getNetworkLocation();
	this.m_defaultSyncType = sessionFeatures.getDefaultSyncType();
	this.m_capabilities = sessionFeatures.getCapabilities();
	let environment = oFF.XEnvironment.createCopy(sessionFeatures.getEnvironment());
	this.m_globalInterruptManager = sessionFeatures.getGlobalInterruptManager();
	this.m_proxySettings = oFF.ProxySettings.create(sessionFeatures.getProxySettings());
	this.m_featureToggles.addAll(sessionFeatures.getFeatureTogglesByName());
	this.m_logWriterInterceptor = this.m_microKernel.getSessionInterceptorHub().getLogWriterInterceptor();
	this.m_profileWriterInterceptor = this.m_microKernel.getSessionInterceptorHub().getProfileWriterInterceptor();
	this.m_httpExchangeInterceptor = this.m_microKernel.getSessionInterceptorHub().getHttpExchangeInterceptor();
	this.m_callInterceptor = this.m_microKernel.getSessionInterceptorHub().getCallInterceptor();
	let stdioContext = sessionFeatures.getStdioContext();
	if (oFF.notNull(stdioContext))
	{
		this.m_stdin = stdioContext.getStdin();
		this.m_stdout = stdioContext.getStdout();
		this.m_stdlog = stdioContext.getStdlog();
		this.m_stderr = stdioContext.getStderr();
	}
	this.m_logWriterMaster = oFF.XLogWriterSession.createWithSession(this, this.m_stdlog, this.m_stderr);
	let severity = oFF.Severity.fromName(environment.getStringByKey(oFF.XEnvironmentConstants.FIREFLY_LOG_SEVERITY));
	this.m_logWriterMaster.setLogFilterSeverity(oFF.isNull(severity) ? oFF.Severity.ERROR : severity);
	this.m_logWriter = this.m_logWriterMaster;
	environment.setLogWriter(this.m_logWriterMaster);
	this.m_environment = environment;
	this.m_xVersion = this.getValidXVersion();
};
