oFF.XLogWriterSession = function() {};
oFF.XLogWriterSession.prototype = new oFF.XLogWriter();
oFF.XLogWriterSession.prototype._ff_c = "XLogWriterSession";

oFF.XLogWriterSession.createWithSession = function(session, output, errorStream)
{
	let logWriter = new oFF.XLogWriterSession();
	logWriter.setupWithSession(session, output, errorStream);
	return logWriter;
};
oFF.XLogWriterSession.prototype.m_logWriterInterceptor = null;
oFF.XLogWriterSession.prototype.m_session = null;
oFF.XLogWriterSession.prototype.isLogWritten = function(layer, severity)
{
	let isWritten = oFF.XLogWriter.prototype.isLogWritten.call( this , layer, severity);
	if (isWritten === false)
	{
		isWritten = this.m_logWriterInterceptor.hasLogInterceptor();
	}
	return isWritten;
};
oFF.XLogWriterSession.prototype.logExt = function(layer, severity, code, message)
{
	let theSeverity = severity;
	if (oFF.isNull(theSeverity))
	{
		theSeverity = oFF.Severity.DEBUG;
	}
	let text = oFF.DfLogWriter.createLogString(layer, theSeverity, code, message);
	this.m_logWriterInterceptor.interceptLog(this.m_session, layer, theSeverity, code, message);
	if (theSeverity === oFF.Severity.ERROR && oFF.notNull(this.m_errorOutput))
	{
		this.m_errorOutput.printError(text);
	}
	else if (oFF.notNull(this.m_output) && this.isLogWritten(layer, theSeverity))
	{
		this.m_output.println(text);
	}
};
oFF.XLogWriterSession.prototype.releaseObject = function()
{
	this.m_session = null;
	this.m_logWriterInterceptor = null;
	oFF.XLogWriter.prototype.releaseObject.call( this );
};
oFF.XLogWriterSession.prototype.setupWithSession = function(session, output, errorStream)
{
	oFF.XLogWriter.prototype.setupExt.call( this , output, errorStream);
	this.m_session = session;
	this.m_logWriterInterceptor = session.getSessionInterceptorHub().getLogWriterInterceptor();
};

