oFF.HttpSamlClient = function() {};
oFF.HttpSamlClient.prototype = new oFF.DfHttpClient();
oFF.HttpSamlClient.prototype._ff_c = "HttpSamlClient";

oFF.HttpSamlClient.FIFTH_STEP = 5;
oFF.HttpSamlClient.FINAL_STEP = 6;
oFF.HttpSamlClient.FOURTH_STEP = 4;
oFF.HttpSamlClient.INITIAL_STEP = 1;
oFF.HttpSamlClient.SECOND_STEP = 2;
oFF.HttpSamlClient.THIRD_STEP = 3;
oFF.HttpSamlClient.create = function(session)
{
	let client = new oFF.HttpSamlClient();
	client.setupInternal(session);
	return client;
};
oFF.HttpSamlClient.prototype.m_areFilesAccessible = false;
oFF.HttpSamlClient.prototype.m_ignoredErrorCodes = null;
oFF.HttpSamlClient.prototype.m_isAuthenticated = false;
oFF.HttpSamlClient.prototype.m_passwordSent = false;
oFF.HttpSamlClient.prototype.m_reAuthenticationAllowed = false;
oFF.HttpSamlClient.prototype.m_step = 0;
oFF.HttpSamlClient.prototype.getCurrentTheme = function()
{
	let environment = this.getSession().getMicroKernel().getEnvironment();
	return environment.getStringByKeyExt(oFF.XEnvironmentConstants.FIREFLY_UI_THEME, "sap_belize");
};
oFF.HttpSamlClient.prototype.getIdpStorageAccess = function()
{
	let environment = this.getSession().getEnvironment();
	let request = this.getRequest();
	let isEnvVarEnabled = environment.getBooleanByKeyExt(oFF.XEnvironmentConstants.FIREFLY_ENABLE_SAML_VISIBLE_IFRAME_AUTH, false);
	let isFTEnabled = this.getSession().hasFeature(oFF.FeatureToggleSAC.FF_ENABLE_SAML_VISIBLE_IFRAME_AUTH);
	let isIdpRendersStorageAccess = request.isIdpRendersStorageAccess() !== null && request.isIdpRendersStorageAccess().getBoolean();
	if (isEnvVarEnabled || isFTEnabled)
	{
		return oFF.XBooleanValue.create(isIdpRendersStorageAccess);
	}
	return null;
};
oFF.HttpSamlClient.prototype.handleSamlWorkflow = function()
{
	let isIos = oFF.SamlUtils.isIos();
	if (this.isRequestSamlCompliantAndUnauthenticated() && this.m_step === oFF.HttpSamlClient.SECOND_STEP)
	{
		this.addError(oFF.HttpErrorCode.HTTP_NOT_AUTHENTICATED, "Authentication cancelled by user. Not Authenticated.");
		this.endSync();
		return;
	}
	if (this.m_step === oFF.HttpSamlClient.INITIAL_STEP)
	{
		this.m_step = this.m_step + 1;
		this.clearMessages();
		this.popupSamlWindow();
	}
	else if (this.hasNoIdpStorageAccess() && this.m_step >= oFF.HttpSamlClient.SECOND_STEP && this.m_step <= oFF.HttpSamlClient.FINAL_STEP && !isIos)
	{
		this.handleThirdPartyCookiesWorkflow();
	}
	else if (this.hasIdpStorageAccess() && this.m_step === oFF.HttpSamlClient.SECOND_STEP && !isIos)
	{
		this.m_step = this.m_step + 1;
		this.clearMessages();
		oFF.IframeHandler.createInvisibleToVisibleIframe(this.getRequest(), this, oFF.SamlUtils.getAuthTimeout(this.getSession()));
	}
	else
	{
		if (this.isRequestSamlCompliantAndUnauthenticated())
		{
			this.addError(oFF.HttpErrorCode.HTTP_IO_EXCEPTION, "Data source is not accessible.");
		}
		else
		{
			this.addError(oFF.HttpErrorCode.HTTP_SAML_AUTHENTICATION_FAILED, "Authentication failed.");
		}
		this.endSync();
	}
};
oFF.HttpSamlClient.prototype.handleThirdPartyCookiesWorkflow = function()
{
	if (this.m_step === oFF.HttpSamlClient.SECOND_STEP)
	{
		this.m_step = this.m_step + 1;
		this.verifyFileExistenceViaIframe();
	}
	else if (this.m_step === oFF.HttpSamlClient.THIRD_STEP || this.m_step === oFF.HttpSamlClient.FOURTH_STEP)
	{
		this.verifyFileExistenceViaIframe();
	}
	else if (this.m_step === oFF.HttpSamlClient.FIFTH_STEP && this.hasNoIdpStorageAccess())
	{
		this.m_step = this.m_step + 1;
		this.setData(null);
		if (!this.m_areFilesAccessible)
		{
			let FILE_CHECK_ERROR_MESSAGE = oFF.XStringUtils.concatenate2(oFF.StorageAccessDialogConstants.CONSOLE_FILE_CHECK_ERROR_MESSAGE, oFF.StorageAccessDialogConstants.SUPPORT_DOCUMENTATION_URL_NO_FILES);
			this.logExt(oFF.OriginLayer.IOLAYER, oFF.Severity.PRINT, 0, FILE_CHECK_ERROR_MESSAGE);
			this.addError(oFF.HttpErrorCode.HTTP_3PC_FLOW_TERMINATED, "3PCD file existence check failed.");
			this.endSync();
		}
		else
		{
			oFF.IframeHandler.createStorageAccessDialog(this.getRequest(), this.getSession(), this, 0, this.getCurrentTheme());
		}
	}
	else if (this.m_step === oFF.HttpSamlClient.FINAL_STEP && this.hasNoIdpStorageAccess())
	{
		this.m_step = this.m_step + 1;
		this.clearMessages();
		this.sendRequest(this.getActiveSyncType());
	}
};
oFF.HttpSamlClient.prototype.hasIdpStorageAccess = function()
{
	return this.getIdpStorageAccess() !== null && this.getIdpStorageAccess().getBoolean();
};
oFF.HttpSamlClient.prototype.hasNoIdpStorageAccess = function()
{
	return this.getIdpStorageAccess() !== null && !this.getIdpStorageAccess().getBoolean();
};
oFF.HttpSamlClient.prototype.isAuthenticated = function()
{
	return this.m_isAuthenticated;
};
oFF.HttpSamlClient.prototype.isOk = function(statusCode, contentType)
{
	return statusCode === oFF.HttpStatusCode.SC_OK && (contentType === oFF.ContentType.APPLICATION_JSON || contentType === oFF.ContentType.APPLICATION_XML);
};
oFF.HttpSamlClient.prototype.isRequestSamlCompliantAndUnauthenticated = function()
{
	return this.isSamlStandardCompliant() && !this.isAuthenticated();
};
oFF.HttpSamlClient.prototype.isSamlStandardCompliant = function()
{
	return this.getRequest().isSamlStandardCompliant() && !oFF.SamlUtils.isIos();
};
oFF.HttpSamlClient.prototype.onAuthenticationTimeout = function()
{
	this.addError(oFF.HttpErrorCode.HTTP_SAML_TIMEOUT, "AUTHENTICATION_TIMEOUT");
	this.onWindowClose();
};
oFF.HttpSamlClient.prototype.onHttpResponse = function(extResult, response, customIdentifier)
{
	let samlResponse;
	this.addAllMessages(extResult);
	let isPopupSupported = oFF.SamlUtils.isPopupSupported();
	let isLogOff = this.getRequest().isLogoff() || this.getRequest().getRequestType().isEqualTo(oFF.HttpSemanticRequestType.LOGOUT);
	if (oFF.isNull(response))
	{
		this.addError(oFF.HttpErrorCode.HTTP_EMPTY_RESPONSE_OBJECT, "Internal Error");
		this.endSync();
		return;
	}
	let statusCode = response.getStatusCode();
	let httpContentType = response.getContentType();
	if (this.isOk(statusCode, httpContentType))
	{
		oFF.XStream.of(this.m_ignoredErrorCodes).forEach((errorCode) => {
			if (this.containsCode(oFF.Severity.ERROR, errorCode.getInteger()))
			{
				this.removeError(errorCode.getInteger());
			}
		});
	}
	if (isPopupSupported && isLogOff)
	{
		this.endSync();
	}
	else if (this.hasErrors())
	{
		if (isPopupSupported)
		{
			this.resetClientState();
			this.handleSamlWorkflow();
		}
		else
		{
			this.endSync();
		}
	}
	else
	{
		if (this.isOk(statusCode, httpContentType))
		{
			this.setData(response);
			this.endSync();
		}
		else
		{
			let session = this.getSession();
			let originSite = response.getHttpRequest().getUri();
			if (statusCode === oFF.HttpStatusCode.SC_SEE_OTHER || statusCode === oFF.HttpStatusCode.SC_FOUND)
			{
				let location = response.getLocation();
				if (oFF.notNull(location))
				{
					let locationUri = oFF.XUri.createFromParentUriAndRelativeUrl(originSite, location, false);
					let redirectRequest = oFF.HttpRequest.createByUri(locationUri);
					oFF.XConnectHelper.applyProxySettings(redirectRequest, session);
					redirectRequest.setIsRewritingApplied(true);
					redirectRequest.setAcceptContentType(oFF.ContentType.WILDCARD);
					redirectRequest.setMethod(oFF.HttpRequestMethod.HTTP_GET);
					redirectRequest.getHeaderFieldsBase().put(oFF.HttpConstants.HD_CSRF_TOKEN, oFF.HttpConstants.VA_CSRF_FETCH);
					let cookiesMasterStore = this.getRequest().getCookiesMasterStore();
					redirectRequest.setCookiesMasterStore(cookiesMasterStore);
					this.m_step = this.m_step + 1;
					let httpClient = redirectRequest.newHttpClient(session);
					httpClient.processHttpRequest(this.getActiveSyncType(), this, null);
				}
				else
				{
					samlResponse = oFF.HttpResponse.createResponse(this.getRequest());
					samlResponse.setStatusCode(oFF.HttpStatusCode.SC_NOT_ACCEPTABLE);
					samlResponse.setStatusCodeDetails("SAML Response does not contain redirect location");
					this.addError(0, "SAML Response does not contain redirect location");
					this.setData(samlResponse);
					this.endSync();
				}
			}
			else
			{
				let stopProcessing = false;
				if (statusCode === oFF.HttpStatusCode.SC_UNAUTHORIZED)
				{
					if (isPopupSupported)
					{
						stopProcessing = true;
						this.resetClientState();
						this.handleSamlWorkflow();
					}
					else
					{
						let authenticate = response.getHeaderFields().getStringByKey(oFF.HttpConstants.HD_WWW_AUTHENTICATE);
						let isBasicSupported = oFF.XStringUtils.isNotNullAndNotEmpty(authenticate) && oFF.XString.startsWith(authenticate, oFF.HttpConstants.VA_AUTHORIZATION_BASIC);
						if (isBasicSupported)
						{
							stopProcessing = true;
							this.setData(response);
							this.endSync();
						}
					}
				}
				if (statusCode === oFF.HttpStatusCode.SC_FORBIDDDEN || statusCode === oFF.HttpStatusCode.SC_INTERNAL_SERVER_ERROR)
				{
					this.setData(response);
					this.endSync();
					stopProcessing = true;
				}
				if (!stopProcessing)
				{
					let contentType = response.getContentType();
					if (contentType.isTypeOf(oFF.ContentType.TEXT_OR_HTML))
					{
						if (isPopupSupported)
						{
							this.resetClientState();
							this.handleSamlWorkflow();
						}
						else
						{
							let html = response.getString();
							let identityProviderForm = oFF.HtmlForm.create(originSite, html);
							let identityProviderScript = oFF.SamlRedirectScript.create(originSite, html);
							if (identityProviderForm.isValid())
							{
								if (identityProviderForm.getParameterValue("j_username") !== null)
								{
									if (this.m_passwordSent && identityProviderForm.getParameterValue("SAMLResponse") === null)
									{
										this.addError(0, "Failed to login: Bad Username or password");
										samlResponse = oFF.HttpResponse.createResponse(this.getRequest());
										samlResponse.setStatusCode(oFF.HttpStatusCode.SC_UNAUTHORIZED);
										samlResponse.setStatusCodeDetails("Failed to login: Bad Username or password");
										this.setData(samlResponse);
										stopProcessing = true;
									}
									else
									{
										this.m_passwordSent = true;
										let masterRequest = this.getRequest();
										identityProviderForm.set("j_username", masterRequest.getUser());
										identityProviderForm.set("j_password", masterRequest.getPassword());
									}
								}
								if (stopProcessing)
								{
									this.endSync();
								}
								else
								{
									this.postForm(session, identityProviderForm, false);
								}
							}
							else if (identityProviderScript.isValid())
							{
								let locUri = identityProviderScript.getTarget();
								let cookMasterStore = this.getRequest().getCookiesMasterStore();
								if (identityProviderScript.getSignature() !== null)
								{
									let cookies = oFF.HttpCookies.create();
									let cookie = oFF.HttpCookie.createCookie("signature", identityProviderScript.getSignature());
									cookie.setPath("/");
									cookies.addCookie(cookie);
									cookie = oFF.HttpCookie.createCookie("fragmentAfterLogin", this.getRequest().getFragment());
									cookie.setPath("/");
									cookies.addCookie(cookie);
									cookie = oFF.HttpCookie.createCookie("locationAfterLogin", oFF.XHttpUtils.encodeURIComponent(this.getRequest().getUrlExt(false, false, false, false, false, false, true, true, false)));
									cookie.setPath("/");
									cookies.addCookie(cookie);
									cookMasterStore.applyCookies(this.getRequest().getHost(), this.getRequest().getPath(), cookies);
								}
								let scriptRedirectRequest = oFF.HttpRequest.createByUri(locUri);
								scriptRedirectRequest.setIsRewritingApplied(true);
								scriptRedirectRequest.setAcceptContentType(oFF.ContentType.WILDCARD);
								scriptRedirectRequest.setMethod(oFF.HttpRequestMethod.HTTP_GET);
								scriptRedirectRequest.setCookiesMasterStore(cookMasterStore);
								this.m_step = this.m_step + 1;
								let httpClient = scriptRedirectRequest.newHttpClient(session);
								httpClient.processHttpRequest(this.getActiveSyncType(), this, null);
							}
							else
							{
								this.setData(response);
								this.endSync();
							}
						}
					}
					else
					{
						this.clearMessages();
						this.addError(oFF.HttpErrorCode.HTTP_NO_CONDITION_FULFILLED, "Internal error");
						this.setData(response);
						this.endSync();
					}
				}
			}
		}
	}
};
oFF.HttpSamlClient.prototype.onIframeCancelled = function()
{
	this.addError(oFF.HttpErrorCode.HTTP_3PC_DIALOG_CANCELLED, "Storage access flow cancelled");
	this.endSync();
};
oFF.HttpSamlClient.prototype.onIframeClose = function()
{
	this.sendRequest(this.getActiveSyncType());
};
oFF.HttpSamlClient.prototype.onWindowClose = function()
{
	this.sendRequest(this.getActiveSyncType());
};
oFF.HttpSamlClient.prototype.popupSamlWindow = function()
{
	let environment = this.getSession().getEnvironment();
	if (environment.getBooleanByKeyExt(oFF.XEnvironmentConstants.FIREFLY_ENABLE_SAML_INVISIBLE_IFRAME_AUTH, false))
	{
		oFF.SamlUtils.startInvisibleIframeAuthentication(this.getRequest(), this.getSession(), this);
	}
	else
	{
		let windowOpen = false;
		try
		{
			windowOpen = oFF.SamlUtils.popupAuthentication(this.getRequest(), this.getSession(), this);
		}
		catch (e)
		{
			this.addError(oFF.HttpErrorCode.HTTP_BAD_REQUEST, "HTTP_BAD_REQUEST");
			this.endSync();
		}
		if (!windowOpen)
		{
			this.addError(oFF.HttpErrorCode.HTTP_SAML_POPUP_BLOCKED, "SAML_POPUP_BLOCKED");
			this.sendRequest(this.getActiveSyncType());
		}
	}
};
oFF.HttpSamlClient.prototype.postForm = function(session, form, useCertificates)
{
	this.m_step = this.m_step + 1;
	let uri = form.getTarget();
	let request = oFF.HttpRequest.createByUri(uri);
	request.setAcceptContentType(oFF.ContentType.WILDCARD);
	if (useCertificates)
	{
		request.setAuthenticationType(oFF.AuthenticationType.CERTIFICATES);
	}
	else
	{
		request.setAuthenticationType(oFF.AuthenticationType.NONE);
	}
	request.setMethod(oFF.HttpRequestMethod.HTTP_POST);
	let masteruri = form.getOriginSite();
	let referer = masteruri.getUrl();
	request.setReferer(referer);
	let originUri = oFF.XUri.createFromOther(masteruri);
	originUri.setFragment(null);
	originUri.setPath(null);
	originUri.setQuery(null);
	originUri.setAuthenticationType(oFF.AuthenticationType.NONE);
	let origin = originUri.getUrl();
	request.setOrigin(origin);
	let cookiesMasterStore = this.getRequest().getCookiesMasterStore();
	request.setCookiesMasterStore(cookiesMasterStore);
	let buffer = oFF.XStringBuffer.create();
	let names = form.getNames();
	let hasValue = false;
	while (names.hasNext())
	{
		let name = names.next();
		let type = form.getParameterType(name);
		if (!oFF.XString.isEqual(type, "submit"))
		{
			if (hasValue)
			{
				buffer.append("&");
			}
			hasValue = true;
			buffer.append(name).append("=");
			let value = form.getParameterValue(name);
			let valueEnc = oFF.XHttpUtils.encodeURIComponent(value);
			buffer.append(valueEnc);
		}
	}
	let content = buffer.toString();
	request.setString(content);
	request.setContentType(oFF.ContentType.APPLICATION_FORM);
	let httpClient = request.newHttpClient(session);
	return httpClient.processHttpRequest(this.getActiveSyncType(), this, null);
};
oFF.HttpSamlClient.prototype.processSynchronization = function(syncType)
{
	this.m_step = 1;
	this.m_passwordSent = false;
	this.m_areFilesAccessible = false;
	this.m_isAuthenticated = false;
	this.m_reAuthenticationAllowed = this.getRequest().isConnected();
	let isLogOff = this.getRequest().isLogoff() || this.getRequest().getRequestType().isEqualTo(oFF.HttpSemanticRequestType.LOGOUT);
	if (oFF.SamlUtils.isPopupSupported() && !this.getRequest().isConnected() && !isLogOff)
	{
		this.m_step = oFF.HttpSamlClient.SECOND_STEP;
		this.popupSamlWindow();
	}
	else
	{
		this.m_step = oFF.HttpSamlClient.SECOND_STEP;
		this.sendRequest(syncType);
	}
	return true;
};
oFF.HttpSamlClient.prototype.removeError = function(errorCode)
{
	let messages = this.getMessages();
	this.clearMessages();
	oFF.XStream.of(messages).forEach((message) => {
		if (message.getCode() !== errorCode)
		{
			this.addMessage(message);
		}
	});
};
oFF.HttpSamlClient.prototype.resetClientState = function()
{
	if (this.m_reAuthenticationAllowed)
	{
		this.m_reAuthenticationAllowed = false;
		this.m_step = oFF.HttpSamlClient.INITIAL_STEP;
	}
};
oFF.HttpSamlClient.prototype.sendRequest = function(syncType)
{
	let request = this.getRequest();
	let serviceRequest = oFF.HttpRequest.createByHttpRequest(request);
	serviceRequest.setAuthenticationType(oFF.AuthenticationType.NONE);
	serviceRequest.setAcceptContentType(oFF.ContentType.WILDCARD);
	serviceRequest.setUser(null);
	serviceRequest.setPassword(null);
	serviceRequest.setIsRewritingApplied(true);
	let serviceRequestClient = serviceRequest.newHttpClient(this.getSession());
	serviceRequestClient.processHttpRequest(syncType, this, null);
};
oFF.HttpSamlClient.prototype.setIsAuthenticated = function(isAuthenticated)
{
	this.m_isAuthenticated = isAuthenticated;
};
oFF.HttpSamlClient.prototype.setupInternal = function(session)
{
	this.setupHttpClient(session);
	let ignoredErrorCodes = oFF.XList.create();
	ignoredErrorCodes.add(oFF.XIntegerValue.create(oFF.HttpErrorCode.HTTP_SAML_TIMEOUT));
	ignoredErrorCodes.add(oFF.XIntegerValue.create(oFF.HttpErrorCode.HTTP_SAML_POPUP_BLOCKED));
	this.m_ignoredErrorCodes = ignoredErrorCodes;
};
oFF.HttpSamlClient.prototype.verifyFileExistenceViaIframe = function()
{
	let request = oFF.HttpRequest.createByUrl(this.getRequest().getUrl());
	request.setQuery("");
	request.setPath(this.m_step === oFF.HttpSamlClient.THIRD_STEP ? this.getRequest().getStorageHtmlPath() : this.getRequest().getTopLevelHtmlPath());
	oFF.IframeHandler.createMessageIframe(request.getUrl(), oFF.LambdaEventMessageListener.create((data) => {
		this.m_areFilesAccessible = true;
		this.m_step = this.m_step + 1;
		this.handleSamlWorkflow();
	}, () => {
		this.m_areFilesAccessible = false;
		this.m_step = oFF.HttpSamlClient.FIFTH_STEP;
		this.handleSamlWorkflow();
	}), oFF.MessageIframeOption.STORAGE_ACCESS_FILES_CHECK);
};

